import React from 'react'

const Log = () => {
  return (
    <main className='Log'>
        <h2>Log</h2>
        <p style={{ marginTop: '1rem' }}>
          This is the page of the Log.<br/><br/>
        </p>
        <h1>Working in progress</h1>
    </main>
  )
}

export default Log
